import React from "react";
import data from "../data/card-data";

function Knapsack(){
    return(
        <div className= "container">
            <h1 classname="problem-heading">Knapsack Problem</h1>
            <p className= "problem-desc">{data[0].description}</p>
        </div>
    )
}

export default Knapsack;
